import React from 'react'
import '../Styles/img.css'
import Im from './Img'
const axios = require('axios').default
export default function Reports() {
    const generateAVL_En = () =>{
        var data ={
            "tipo": 0
        }
        JSON.stringify(data)

        async function generateAVL(){
            const info = await axios.get('http://localhost:3000/reporte',data)
        }
        generateAVL()

    }
    return (
        <div>
            <div class="blue ui buttons">
            <button class="ui button"onClick={generateAVL_En}>AVL Encrypt</button>
            <button class="ui button">AVL No Encrypt</button>
            <button class="ui button">Table Hash</button>
            </div>
        </div>
    )
}
